import * as UserServices from "../../services/user.services";

function Participantes({ arrayParticipacion }) {
  console.log('%cParticipantes.jsx line:5 arrayParticipacion', 'color: #007acc;', arrayParticipacion);
  const [participantes, setParticipantes] = useState([]);

  useEffect (() => {
    UserServices.getAllUsers(arrayParticipacion)
    .then((data) => { 
      setParticipantes(data);
    })
    .catch((error) => console.log(error));
  }, [arrayParticipacion]);

  return (
    <div className="card mb-3">
      <div className="card-header">
        <h2>Participantes</h2>
      </div>
      <ol className="list-group list-group-numbered">
        {/* {participantes ? (
          participantes.map((user) => (
            <ParticipanteLista key={user._id} usuario={user} />
          ))
        ) : (
          <li className="p-2 text-center">No hay participantes</li>
        )} */}
      </ol>
    </div>
  );
}

export default Participantes;
